<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <title>Test Page for FrankenPHP</title>
    <style>
        * {
            box-sizing: border-box;
        }

        html {
            height: 100%;
        }

        body {
            background: #fff;
            color: #000;
            font-size: 0.9em;
            font-family: sans-serif, helvetica;
            margin: 0;
            padding: 0;
            height: 100%;
        }

        a {
            color: #390075;
            font-weight: bold;
        }

        h2 {
            font-size: 1.5em;
            font-weight: bold;
            color: #390075;
        }

        main {
            display: flex;
            margin-left: auto;
            margin-right: auto;
            height: 100%;
        }

        .content {
            flex: 1;
            display: flex;
            flex-direction: column;
            gap: 10px;
            padding: 1.5em 3em;

            section {
                max-width: 600px;
            }
        }

        .runtime-info {
            background: #efefef;
            padding: 0.5em;
            margin-top: 1em;
            font-size: 0.85em;
            border-left: 3px solid #390075;
        }

        .right {
            overflow: auto;
            flex: 1;
            display: flex;
            flex-direction: column;
        }

        .left {
            width: 40%;
            background: #230143;
            color: #fff;
            position: relative;
            text-align: center;
            padding-top: 1em;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            gap: 1em;

            .logo {
                width: 80%;
                max-width: 400px;
                margin-left: auto;
                margin-right: auto;
            }

            .franky {
                width: 80%;
                max-width: 400px;
                margin-bottom: 1em;
            }
        }

        footer {
            border-top: 1px solid #ccc;
            font-size: 0.8em;
            padding: 1em 3em;
            display: flex;
            flex-direction: column;
            gap: 1em;

            .logos {
                display: flex;
                gap: 12px;
                align-items: center;
            }

            svg {
                width: 120px;
            }

            p {
                padding: 0;
                margin: 0;
            }
        }

        @media (max-width: 768px) {
            main {
                flex-direction: column;
            }

            .right {
                overflow: visible;
            }

            .left {
                width: 100%;
                flex-direction: row;
                padding: 1em;

                .logo {
                    max-width: 250px;
                }

                .franky {
                    height: 100px;
                    width: auto;
                }

                .logo {
                    margin: 0;
                }
            }

            .content {
                padding: 1em 2em;
            }

            footer {
                padding: 1em 2em;
                text-align: center;
                margin-top: 1em;

                .logos {
                    justify-content: center;
                }

            }
        }
    </style>
</head>

